import React, { Component } from 'react';
import './/header.css'


class Header extends Component {
    render() {
        return (
            <div className='header container'>
                <div className='header__logo'>
                    <a className='header__text'>Exclusive</a>
                </div>
                <nav className='header__nav'>
                <ul>
                    <li><a href = '#!'>Home</a></li>
                    <li><a href = '#!'>Contact</a></li>
                    <li><a href = '#!'>About</a></li>
                    <li><a href = '#!'>Home</a></li>
                </ul>
                </nav>
                <div className='header__item'>
                    <div className='header__search'>
                        <input className='search__text' placeholder='What are you looking for?'><span src='./icons/seacr.png'></span></input>
                    </div>
                    <img src='./icons/Favorite.png' href = '#'></img>
                    <img src='./icons/busket.png' href = '#'></img>
                </div>
            </div>
        );
    }
}

export default Header;
